import './App.css';
import GraphComponent from './components/GraphComponent';
function App() {
  return (
    <div className="App">
      <div className="container">
        <h1 className="title">Sorting Visualizer</h1>
        <GraphComponent/>
      </div>
    </div>
  );
}

export default App;
